import React from 'react';
import { Container, Row, Col, Card, Form, FormGroup } from 'reactstrap';
import MenuSuperior from '../menuSuperior/MenuSuperior';

import { TextField, Select, MenuItem, InputLabel, Button } from "@material-ui/core";
import { withStyles } from '@material-ui/core/styles';

import { MDBInput, MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';
import Grid from "antd/lib/card/Grid";



const data_checkboxes = {
    columns: [
        {
            'check': <MDBInput type="checkbox" id="checkbox2" />,
            'field': 'check',
            'sort': 'asc'

        },
        {
            'label': 'Código',
            'field': 'lorem',
            'sort': 'asc'
        },
        {
            'label': 'Descrição',
            'field': 'lorem',
            'sort': 'asc',
        },
    ],
    rows: [
        {

            'check': <MDBInput type="checkbox" id="checkbox2" />,
            'Descrição': ' ',

        },
    ]
};

const CssTextField = withStyles({
    root: {
        "& label.Mui-focused": {
            color: "black"
        },
        "& label": {
            color: "black"
        },
        "& .MuiInput-underline:before": {
            borderBottomColor: "black"
        },
        "& .MuiInput-underline:after": {
            borderBottomColor: "black"
        },
        "& .MuiOutlinedInput-root": {
            "& fieldset": {
                borderColor: "black"
            },
            "&:hover fieldset": {
                borderColor: "black"
            },
            "&.Mui-focused fieldset": {
                borderColor: "black"
            }
        }
    }
})(TextField);

const movimentacao = (props) => {
    return (
        <div>
            <MenuSuperior />
            <Container>
                <Row>
                    <Col >
                        <Card style={{ width: "100%", height: "300%", margin: '30px 0 0 0' }}>
                            <Form>
                                <p>PEDIDOS</p>
                            </Form>
                        </Card>
                    </Col>
                    <Col>
                        <Card style={{ width: "100%", height: "300%", margin: '30px 0 0 0' }}>
                            <Form>
                                <p>ENTRADAS</p>
                            </Form>
                        </Card>
                    </Col>
                    <Col >
                        <Card style={{ width: "100%", height: "300%", margin: '30px 0 0 0' }}>
                            <Form>
                                <p>DEVOLUÇÕES</p>
                            </Form>
                        </Card>
                    </Col>
                    <Col>
                        <Card style={{ width: "100%", height: "300%", margin: '30px 0 0 0' }}>
                            <Form>
                                <p>TROCAS</p>
                            </Form>
                        </Card>
                    </Col>
                </Row>

                <Row>
                    <Col sm={12} md={4} lg={4} xl={4} >
                        <Card style={{ width: "100%", height: "100%", margin: '60% 0 0 0' }}>
                            <FormGroup>
                                <TextField
                                    id="standard-data-input"
                                    label="De:"
                                    type="data"
                                />
                                <TextField
                                    id="standard-data-input"
                                    label="Até:"
                                    type="data"
                                />
                            </FormGroup>
                            <FormGroup >
                                <InputLabel id="select-label"></InputLabel>
                                <Select
                                    labelId="select-label"
                                    id="select"
                                    label="Buscar"
                                    style={{ width: "100%", height: "100%", margin: '0 0 0 0' }}
                                >
                                    <MenuItem selected disabled value="">Selecione Opção</MenuItem>
                                    <MenuItem value=""></MenuItem>
                                    <MenuItem value=""></MenuItem>
                                    <MenuItem value=""></MenuItem>
                                </Select>
                            </FormGroup>
                            <Row>
                                <Col sm={12}>
                                    <FormGroup>
                                        <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '0 0 0 0', fontSize: "13px" }}>Filtrar</Button>{' '}
                                    </FormGroup>
                                </Col>
                            </Row>
                        </Card>
                    </Col>

                    <Col sm={12} md={4} lg={4} xl={4}>
                        <Form>
                            <Grid>
                                <MDBTable bordered style={{ margin: '0 0 0 0' }}>
                                    <MDBTableHead columns={data_checkboxes.columns} />
                                    <MDBTableBody rows={data_checkboxes.rows} />
                                </MDBTable>
                            </Grid>
                        </Form>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}
export default movimentacao;
